INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カリン", 190804, 3.414, -416.5, 0.0, 2, 1, 1, 62, "2025/01/31 12:00:00", 1000001, 1, "2030/01/01 14:59:59", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カリン", 190804, 3.099, -416.5, 0.0, 2, 1, 2, 62, "2025/01/31 12:00:00", 1000002, 1, "2030/01/01 14:59:59", "ミッションをクリアして、\n報酬をゲットしましょう！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カリン", 190804, 2.801, -416.5, 0.0, 2, 1, 3, 63, "2025/01/31 12:00:00", 1000003, 1, "2030/01/01 14:59:59", "受け取ることができる\n報酬があるようです\n確認してみてください");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カリン", 190804, 0.0, -416.5, 0.0, 2, 1, 4, 63, "2025/01/31 12:00:00", 1000004, 2, "2030/01/01 14:59:59", "報酬がもらえますよ！\nチェックしてみてください");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カリン", 190804, 2.12, -363.0, 0.0, 1, 1, 5, 64, "2025/01/31 12:00:00", 1000005, 2, "2030/01/01 14:59:59", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カリン", 190804, 1.68, -363.0, 0.0, 2, 1, 6, 64, "2025/01/31 12:00:00", 1000006, 1, "2030/01/01 14:59:59", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カリン", 190804, 2.33, -363.0, 0.0, 1, 1, 7, 64, "2025/01/31 12:00:00", 1000007, 2, "2030/01/01 14:59:59", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ラビリスタ", 133701, 5.18, -285.0, -6.0, 7, 10201, 101, 61, "2025/01/31 12:00:00", 1020101, 3, "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("クリスティーナ", 133901, 8.77, -285.0, -2.0, 2, 10201, 201, 61, "2025/01/31 12:00:00", 1020102, 1, "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ネネカ", 133801, 15.5, -285.0, 0.0, 1, 10201, 301, 61, "2025/01/31 12:00:00", 1020103, 6, "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ランファ", 134301, 9.061, -285.0, 0.0, 5, 10202, 101, 61, "2025/02/28 12:00:00", 1020201, 2, "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("チカ", 134401, 7.699, -285.0, 0.0, 2, 10202, 201, 61, "2025/02/28 12:00:00", 1020202, 1, "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("アオイ", 134601, 8.595, -285.0, 0.0, 2, 10203, 101, 61, "2025/03/31 12:00:00", 1020301, 1, "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("クローチェ", 134501, 7.758, -285.0, 0.0, 2, 10203, 201, 61, "2025/03/31 12:00:00", 1020302, 1, "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ルイズマリー", 132302, 7.0, -285.0, 0.0, 6, 10204, 101, 61, "2025/04/30 12:00:00", 1020401, 2, "2030/01/01 14:59:59", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("イロハ", 132402, 7.904, -285.0, 0.0, 2, 10204, 201, 61, "2025/04/30 12:00:00", 1020402, 1, "2030/01/01 14:59:59", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ソノ", 132502, 8.487, -285.0, 0.0, 2, 10204, 301, 61, "2025/04/30 12:00:00", 1020403, 4, "2030/01/01 14:59:59", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カノン", 134901, 8.763, -285.0, 0.0, 2, 10205, 101, 61, "2025/05/31 12:00:00", 1020502, 1, "2030/01/01 14:59:59", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ツムギ", 134801, 6.417, -285.0, 0.0, 3, 10205, 201, 61, "2025/05/31 12:00:00", 1020503, 1, "2030/01/01 14:59:59", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("エリス", 135001, 10.335, -285.0, 0.0, 7, 10206, 101, 61, "2025/06/30 12:00:00", 1020601, 3, "2030/01/01 14:59:59", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("シェフィ", 135101, 6.281, -285.0, 0.0, 4, 10206, 201, 61, "2025/06/30 12:00:00", 1020602, 2, "2030/01/01 14:59:59", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("プレシア", 135201, 12.244, -285.0, 0.0, 2, 10206, 301, 61, "2025/06/30 12:00:00", 1020603, 1, "2030/01/01 14:59:59", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("クリア", 135301, 6.339, -285.0, 0.0, 8, 10207, 101, 61, "2025/07/31 12:00:00", 1020701, 2, "2030/01/01 14:59:59", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("アネモネ", 135401, 8.184, -285.0, 0.0, 9, 10207, 201, 61, "2025/07/31 12:00:00", 1020702, 7, "2030/01/01 14:59:59", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("アイラ", 129101, 3.906, -285.0, 0.0, 2, 10208, 101, 61, "2025/08/31 12:00:00", 1020801, 9, "2030/01/01 14:59:59", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("シナツ", 129201, 14.465, -285.0, 0.0, 2, 10208, 201, 61, "2025/08/31 12:00:00", 1020802, 1, "2030/01/01 14:59:59", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ヒヨリ", 100101, 8.662, -285.0, 0.0, 3, 10208, 301, 61, "2025/08/31 12:00:00", 1020803, 4, "2030/01/01 14:59:59", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("レイ", 100301, 10.915, -285.0, 0.0, 3, 10208, 401, 61, "2025/08/31 12:00:00", 1020804, 1, "2030/01/01 14:59:59", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ユキノ", 135802, 6.042, -285.0, 0.0, 7, 10209, 101, 61, "2025/09/30 12:00:00", 1020901, 1, "2030/01/01 14:59:59", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("サツキ", 135903, 9.402, -285.0, 0.0, 1, 10209, 201, 61, "2025/09/30 12:00:00", 1020902, 4, "2030/01/01 14:59:59", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ルルィ", 136902, 8.16, -285.0, 0.0, 1, 10209, 301, 61, "2025/09/30 12:00:00", 1020903, 8, "2030/01/01 14:59:59", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("カスミ", 137401, 5.0, -285.0, 0.0, 2, 10210, 101, 61, "2025/10/31 12:00:00", 1021001, 3, "2030/01/01 14:59:59", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("アラクネ", 136001, 8.12, -285.0, 0.0, 1, 10210, 201, 61, "2025/10/31 12:00:00", 1021002, 4, "2030/01/01 14:59:59", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ナーナ", 136202, 6.386, -285.0, 0.0, 2, 10210, 301, 61, "2025/10/31 12:00:00", 1021003, 4, "2030/01/01 14:59:59", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ユイ", 136402, 7.438, -285.0, 0.0, 4, 10211, 101, 61, "2025/11/30 12:00:00", 1021101, 3, "2030/01/01 14:59:59", "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ミソラ", 136302, 8.35, -285.0, 0.0, 5, 10211, 201, 61, "2025/11/30 12:00:00", 1021102, 1, "2030/01/01 14:59:59", "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("シズル", 136501, 5.0, -285.0, 0.0, 2, 10212, 101, 61, "2025/12/31 12:00:00", 1021201, 1, "2030/01/01 14:59:59", "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("リノ", 137902, 5.25, -285.0, 0.0, 2, 10212, 201, 61, "2025/12/31 12:00:00", 1021202, 1, "2030/01/01 14:59:59", "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES ("ラビリスタ", 106801, 7.5, -285.0, 0.0, 2, 10212, 301, 61, "2025/12/31 12:00:00", 1021203, 1, "2030/01/01 14:59:59", "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！");
